    private AddTowNumbersUseStack.ListNode construct(Integer[] arr) {
        AddTowNumbersUseStack.ListNode listNode = null;
        Stack<Integer> stack = new Stack<>();
        for (Integer integer : Arrays.asList(arr)) {
            stack.push(integer);
        }
        listNode = addTowNumbersUseStack.convertStackToListNode(stack);
        return listNode;
    }

    @Test
    public void testGetListNodeValStack() throws Exception {
        AddTowNumbersUseStack.ListNode listNode = construct(new Integer[]{1, 2, 3});
        Stack<Integer> a = addTowNumbersUseStack.convertListNodeToStack(listNode);
        logger.info("{}", a);
    }

    @Test
    public void testConvertStackToListNode() throws Exception {
        AddTowNumbersUseStack.ListNode listNode = construct(new Integer[]{1, 2, 3, 4});
        Stack<Integer> a = addTowNumbersUseStack.convertListNodeToStack(listNode);
        logger.info("{}", a);
        logger.info("{}", addTowNumbersUseStack.convertStackToListNode(a));
    }

